% Nakano's 5-point method for F+f+k estimation with single known epipole
%
% USAGE:
%   [F, f, k, E] = Ffk5pt_e1_Nakano(e1, m1, m2, c1, c2)
% INPUTS:
%   e1    - 3x1, epipole in homogeneous coordinates
%   m1,m2 - 3x5, 2D point correspondences in homogeneous coordinates 
%   c1,c2 - 1x2, image center of each camera (default: [0,0])
% OUTPUTS:
%   F - 3x3xM, fundamental matrix
%   f - 1xM, focal length
%   k - 1xM, radial lens distortion
%   E - 3x3xM, essential matrix
%   (0 <= M <= 21)
% REFERENCE:
%   G. Nakano, Minimal Solutions to Uncalibrated Two-view Geometry with Known Epipoles, ICCV2023 
function [F, f, k, E] = Ffk5pt_e1_Nakano(e1, m1, m2, c1, c2)
arguments 
    e1 (3,1) double
    m1 (3,5) double
    m2 (3,5) double
    c1 (1,2) double = [0,0]
    c2 (1,2) double = [0,0]
end

e1 = e1 / e1(3);
m1 = m1 ./ m1(3,:);
m2 = m2 ./ m2(3,:);


s  = max(abs([m1(:);m2(:);e1]));
T1 = [1/s   0 -c1(1)/s
        0 1/s -c1(2)/s
        0   0        1];
T2 = [1/s   0 -c2(1)/s
        0 1/s -c2(2)/s
        0   0        1];
m1 = T1*m1;
m2 = T2*m2;
e1 = T1*e1;

x1 = e1(1);
y1 = e1(2);
z1 = x1^2 + y1^2;

r1 = sum(m1(1:2,:).^2);
r2 = sum(m2(1:2,:).^2);
n1 = [zeros(2,5)
      r1];
n2 = [zeros(2,5)
      r2];
A = [m2(1,:)'.*m1', m2(2,:)'.*m1', m2(3,:)'.*m1'];
B = [n2(1,:)'.*m1', n2(2,:)'.*m1', n2(3,:)'.*m1'] + [m2(1,:)'.*n1', m2(2,:)'.*n1', m2(3,:)'.*n1'];
C = [n2(1,:)'.*n1', n2(2,:)'.*n1', n2(3,:)'.*n1'];

X = [...
     A(1,2)*x1 - A(1,1)*y1, A(1,3)*x1 - A(1,1), A(1,5)*x1 - A(1,4)*y1, A(1,6)*x1 - A(1,4), A(1,8)*x1 - A(1,7)*y1, - A(1,7) + x1
     A(2,2)*x1 - A(2,1)*y1, A(2,3)*x1 - A(2,1), A(2,5)*x1 - A(2,4)*y1, A(2,6)*x1 - A(2,4), A(2,8)*x1 - A(2,7)*y1, - A(2,7) + x1
     A(3,2)*x1 - A(3,1)*y1, A(3,3)*x1 - A(3,1), A(3,5)*x1 - A(3,4)*y1, A(3,6)*x1 - A(3,4), A(3,8)*x1 - A(3,7)*y1, - A(3,7) + x1
     A(4,2)*x1 - A(4,1)*y1, A(4,3)*x1 - A(4,1), A(4,5)*x1 - A(4,4)*y1, A(4,6)*x1 - A(4,4), A(4,8)*x1 - A(4,7)*y1, - A(4,7) + x1
     A(5,2)*x1 - A(5,1)*y1, A(5,3)*x1 - A(5,1), A(5,5)*x1 - A(5,4)*y1, A(5,6)*x1 - A(5,4), A(5,8)*x1 - A(5,7)*y1, - A(5,7) + x1];

Y = [...
     0, B(1,3)*x1 - A(1,1)*z1, 0, B(1,6)*x1 - A(1,4)*z1, B(1,8)*x1 - B(1,7)*y1, B(1,9)*x1 - B(1,7) - A(1,7)*z1
     0, B(2,3)*x1 - A(2,1)*z1, 0, B(2,6)*x1 - A(2,4)*z1, B(2,8)*x1 - B(2,7)*y1, B(2,9)*x1 - B(2,7) - A(2,7)*z1
     0, B(3,3)*x1 - A(3,1)*z1, 0, B(3,6)*x1 - A(3,4)*z1, B(3,8)*x1 - B(3,7)*y1, B(3,9)*x1 - B(3,7) - A(3,7)*z1
     0, B(4,3)*x1 - A(4,1)*z1, 0, B(4,6)*x1 - A(4,4)*z1, B(4,8)*x1 - B(4,7)*y1, B(4,9)*x1 - B(4,7) - A(4,7)*z1
     0, B(5,3)*x1 - A(5,1)*z1, 0, B(5,6)*x1 - A(5,4)*z1, B(5,8)*x1 - B(5,7)*y1, B(5,9)*x1 - B(5,7) - A(5,7)*z1];

Z = [...
     0, 0, 0, 0, 0, C(1,9)*x1 - B(1,7)*z1
     0, 0, 0, 0, 0, C(2,9)*x1 - B(2,7)*z1
     0, 0, 0, 0, 0, C(3,9)*x1 - B(3,7)*z1
     0, 0, 0, 0, 0, C(4,9)*x1 - B(4,7)*z1
     0, 0, 0, 0, 0, C(5,9)*x1 - B(5,7)*z1];


G = calcG(X,Y,Z);
Q = [...
     - G(1,1)*y1 - G(2,2)*z1, - G(2,2) - G(1,2)*y1 - G(2,3)*z1, - G(2,3) - G(1,3)*y1 - G(2,4)*z1, - G(2,4) - G(1,4)*y1 - G(2,5)*z1, - G(2,5) - G(1,5)*y1 - G(2,6)*z1, - G(2,6) - G(1,6)*y1
                   G(1,1)*x1,                        G(1,2)*x1,                        G(1,3)*x1,                        G(1,4)*x1,                        G(1,5)*x1,            G(1,6)*x1
                           0,                        G(2,2)*x1,                        G(2,3)*x1,                        G(2,4)*x1,                        G(2,5)*x1,            G(2,6)*x1
     - G(3,1)*y1 - G(4,2)*z1, - G(4,2) - G(3,2)*y1 - G(4,3)*z1, - G(4,3) - G(3,3)*y1 - G(4,4)*z1, - G(4,4) - G(3,4)*y1 - G(4,5)*z1, - G(4,5) - G(3,5)*y1 - G(4,6)*z1, - G(4,6) - G(3,6)*y1
                   G(3,1)*x1,                        G(3,2)*x1,                        G(3,3)*x1,                        G(3,4)*x1,                        G(3,5)*x1,            G(3,6)*x1
                           0,                        G(4,2)*x1,                        G(4,3)*x1,                        G(4,4)*x1,                        G(4,5)*x1,            G(4,6)*x1
                           0,          - G(5,2)*y1 - G(6,3)*z1, - G(6,3) - G(5,3)*y1 - G(6,4)*z1, - G(6,4) - G(5,4)*y1 - G(6,5)*z1, - G(6,5) - G(5,5)*y1 - G(6,6)*z1, - G(6,6) - G(5,6)*y1
                           0,                        G(5,2)*x1,                        G(5,3)*x1,                        G(5,4)*x1,                        G(5,5)*x1,            G(5,6)*x1
                           0,                                0,                        G(6,3)*x1,                        G(6,4)*x1,                        G(6,5)*x1,            G(6,6)*x1];

sols = solve21thdeg(Q);
sols = sols(~imag(sols));
if isempty(sols)
    F = [];
    E = [];
    f = [];
    k = [];
else
    nsols = length(sols);
    F  = zeros(3,3,nsols);
    E  = zeros(3,3,nsols);
    f  = zeros(1,nsols);
    k  = zeros(1,nsols);
    valid = true(1,nsols);
    for i=1:nsols
        k_tmp = sols(i);
        V = [-y1, - k_tmp*z1 - 1,   0,              0,   0,              0
              x1,              0,   0,              0,   0,              0
               0,             x1,   0,              0,   0,              0
               0,              0, -y1, - k_tmp*z1 - 1,   0,              0
               0,              0,  x1,              0,   0,              0
               0,              0,   0,             x1,   0,              0
               0,              0,   0,              0, -y1, - k_tmp*z1 - 1
               0,              0,   0,              0,  x1,              0
               0,              0,   0,              0,   0,             x1];

        alpha = G * [k_tmp^5; k_tmp^4; k_tmp^3; k_tmp^2; k_tmp; 1];
        F_tmp = reshape( V*alpha, 3, 3 )';

        [f_tmp, ~] = fEf_from_F(F_tmp);
        if isempty(f_tmp)
            valid(i) = false;
        else
            k(i) = k_tmp / s^2;
            f(i) = s * f_tmp;
            F_tmp= T2' * F_tmp * T1;
            F(:,:,i) = F_tmp / norm(F_tmp,'fro');
            
            
            K1 = [f(i)  0 c1(1)
                  0  f(i) c1(2)
                  0     0   1];
            K2 = [f(i)  0 c2(1)
                  0  f(i) c2(2)
                  0     0   1];
            
            E_tmp = K2' * F(:,:,i) * K1;
            E(:,:,i) = E_tmp / norm(E_tmp,'fro');
        end
        
    end
    F = F(:,:,valid);
    E = E(:,:,valid);
    f = f(valid);
    k = k(valid);
end


end

